import React from "react";
import "./Content.css";
const Content = (props) => {
  return (
    <div className="content-container">
      {props.data.map((item) => {
        <div className="items-container">
            <span class="picture"></span>
        </div>;
      })}
    </div>
  );
};

export default Content;
